import React from 'react';
import './App.css';
import 'https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css';

import SearchForm from './Components/SearchForm.js';

function App() {
  return (
    <div className="App">
      <SearchForm />
    </div>
  );
}

export default App;
